	'messages:apihelp-main-extended-description' => 'en:<div class="hlist plainlinks api-main-links">
* [[mw:Special:MyLanguage/API:Main_page|Documentation]]
* [[mw:Special:MyLanguage/API:Etiquette|Etiquette & usage guidelines]]
* [[mw:Special:MyLanguage/API:FAQ|FAQ]]
* [https://lists.wikimedia.org/postorius/lists/mediawiki-api.lists.wikimedia.org/ Mailing list]
* [https://lists.wikimedia.org/postorius/lists/mediawiki-api-announce.lists.wikimedia.org/ API Announcements]
* [https://phabricator.wikimedia.org/maniphest/query/GebfyV4uCaLd/#R Bugs & requests]
</div>
<strong>Status:</strong> The MediaWiki API is a mature and stable interface that is actively supported and improved. While we try to avoid it, we may occasionally need to make breaking changes; subscribe to [https://lists.wikimedia.org/hyperkitty/list/mediawiki-api-announce@lists.wikimedia.org/ the mediawiki-api-announce mailing list] for notice of updates.

<strong>Erroneous requests:</strong> When erroneous requests are sent to the API, an HTTP header will be sent with the key "MediaWiki-API-Error" and then both the value of the header and the error code sent back will be set to the same value. For more information see [[mw:Special:MyLanguage/API:Errors_and_warnings|API: Errors and warnings]].

<p class="mw-apisandbox-link"><strong>Testing:</strong> For ease of testing API requests, see [[Special:ApiSandbox]].</p>',
	'messages:apihelp-main-param-action' => 'en:Which action to perform.',
	'messages:apihelp-main-param-format' => 'en:The format of the output.',
	'messages:apihelp-main-param-maxlag' => 'en:Maximum lag can be used when MediaWiki is installed on a database replicated cluster. To save actions causing any more site replication lag, this parameter can make the client wait until the replication lag is less than the specified value. In case of excessive lag, error code <samp>maxlag</samp> is returned with a message like <samp>Waiting for $host: $lag seconds lagged</samp>.<br />See [[mw:Special:MyLanguage/Manual:Maxlag_parameter|Manual: Maxlag parameter]] for more information.',
	'messages:apihelp-main-param-smaxage' => 'en:Set the <code>s-maxage</code> HTTP cache control header to this many seconds. Errors are never cached.',
	'messages:apihelp-main-param-maxage' => 'en:Set the <code>max-age</code> HTTP cache control header to this many seconds. Errors are never cached.',
	'messages:apihelp-main-param-assert' => 'en:Verify that the user is logged in (including possibly as a temporary user) if set to <kbd>user</kbd>, <em>not</em> logged in if set to <kbd>anon</kbd>, or has the bot user right if <kbd>bot</kbd>.',
	'messages:apihelp-main-param-assertuser' => 'en:Verify the current user is the named user.',
	'messages:apihelp-main-param-requestid' => 'en:Any value given here will be included in the response. May be used to distinguish requests.',
	'messages:apihelp-main-param-servedby' => 'en:Include the hostname that served the request in the results.',
	'messages:apihelp-main-param-curtimestamp' => 'en:Include the current timestamp in the result.',
	'messages:apihelp-main-param-responselanginfo' => 'en:Include the languages used for <var>uselang</var> and <var>errorlang</var> in the result.',
	'messages:apihelp-main-param-origin' => 'en:When accessing the API using a cross-domain AJAX request (CORS), set this to the originating domain. This must be included in any pre-flight request, and therefore must be part of the request URI (not the POST body).

For authenticated requests, this must match one of the origins in the <code>Origin</code> header exactly, so it has to be set to something like <kbd>https://en.wikipedia.org</kbd> or <kbd>https://meta.wikimedia.org</kbd>. If this parameter does not match the <code>Origin</code> header, a 403 response will be returned. If this parameter matches the <code>Origin</code> header and the origin is allowed, the <code>Access-Control-Allow-Origin</code> and <code>Access-Control-Allow-Credentials</code> headers will be set.

For non-authenticated requests, specify the value <kbd>*</kbd>. This will cause the <code>Access-Control-Allow-Origin</code> header to be set, but <code>Access-Control-Allow-Credentials</code> will be <code>false</code> and all user-specific data will be restricted.',
	'messages:apihelp-main-param-crossorigin' => 'en:When accessing the API using a cross-domain AJAX request (CORS) and using a session provider that is safe against cross-site request forgery (CSRF) attacks (such as OAuth), use this instead of <code>origin=*</code> to make the request authenticated (i.e., not logged out). This must be included in any pre-flight request, and therefore must be part of the request URI (not the POST body).

Note that most session providers, including standard cookie-based sessions, do not support authenticated CORS and cannot be used with this parameter.',
	'messages:apihelp-main-param-uselang' => 'en:Language to use for message translations. <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo&siprop=languages]]</kbd> returns a list of language codes. You can specify <kbd>user</kbd> to use the current user\'s language preference or <kbd>content</kbd> to use this wiki\'s content language.',
	'messages:apihelp-main-param-variant' => 'en:Variant of the language. Only works if the base language supports variant conversion.',
	'messages:apihelp-main-param-errorformat' => 'en:Format to use for warning and error text output',
	'messages:apihelp-main-paramvalue-errorformat-plaintext' => 'en:Wikitext with HTML tags removed and entities replaced.',
	'messages:apihelp-main-paramvalue-errorformat-wikitext' => 'en:Unparsed wikitext.',
	'messages:apihelp-main-paramvalue-errorformat-html' => 'en:HTML',
	'messages:apihelp-main-paramvalue-errorformat-raw' => 'en:Message key and parameters.',
	'messages:apihelp-main-paramvalue-errorformat-none' => 'en:No text output, only the error codes.',
	'messages:apihelp-main-paramvalue-errorformat-bc' => 'en:Format used prior to MediaWiki 1.29. <var>errorlang</var> and <var>errorsuselocal</var> are ignored.',
	'messages:apihelp-main-param-errorlang' => 'en:Language to use for warnings and errors. <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo&siprop=languages]]</kbd> returns a list of language codes. Specify <kbd>content</kbd> to use this wiki\'s content language or <kbd>uselang</kbd> to use the same value as the <var>uselang</var> parameter.',
	'messages:apihelp-main-param-errorsuselocal' => 'en:If given, error texts will use locally-customized messages from the {{ns:MediaWiki}} namespace.',
	'messages:apihelp-acquiretempusername-summary' => 'en:Acquire a temporary user username and stash it in the current session, if temp account creation is enabled and the current user is logged out. If a name has already been stashed, returns the same name.',
	'messages:apihelp-acquiretempusername-extended-description' => 'en:If the user later performs an action that results in temp account creation, the stashed username will be used for their account. It may also be used in previews. However, the account is not created yet, and the name is not visible to other users.',
	'messages:apihelp-block-summary' => 'en:Block a user.',
	'messages:apihelp-block-param-id' => 'en:The block ID to modify.',
	'messages:apihelp-block-param-user' => 'en:User to block.',
	'messages:apihelp-block-param-userid' => 'en:Specify <kbd>$1user=#<var>ID</var></kbd> instead.',
	'messages:apihelp-block-param-expiry' => 'en:Expiry time. May be relative (e.g. <kbd>5 months</kbd> or <kbd>2 weeks</kbd>) or absolute (e.g. <kbd>2014-09-18T12:34:56Z</kbd>). If set to <kbd>infinite</kbd>, <kbd>indefinite</kbd>, or <kbd>never</kbd>, the block will never expire.',
	'messages:apihelp-block-param-reason' => 'en:Reason for block.',
	'messages:apihelp-block-param-anononly' => 'en:Block anonymous users only (i.e. disable anonymous edits for this IP address, including temporary account edits).',
	'messages:apihelp-block-param-nocreate' => 'en:Prevent account creation.',
	'messages:apihelp-block-param-autoblock' => 'en:Automatically block the last used IP address, and any subsequent IP addresses they try to login from.',
	'messages:apihelp-block-param-noemail' => 'en:Prevent user from sending email through the wiki. (Requires the <code>blockemail</code> right).',
	'messages:apihelp-block-param-hidename' => 'en:Hide the username from the block log. (Requires the <code>hideuser</code> right).',
	'messages:apihelp-block-param-allowusertalk' => 'en:Allow the user to edit their own talk page (depends on <var>[[mw:Special:MyLanguage/Manual:$wgBlockAllowsUTEdit|$wgBlockAllowsUTEdit]]</var>).',
	'messages:apihelp-block-param-reblock' => 'en:If the user is already blocked by a single block, overwrite the existing block. If the user is blocked more than once, this will fail—use the <var>id</var> parameter instead to specify which block to overwrite.',
