	'messages:apihelp-block-param-partial' => 'en:Block user from specific pages or namespaces rather than the entire site.',
	'messages:apihelp-block-param-pagerestrictions' => 'en:List of titles to block the user from editing. Only applies when <var>partial</var> is set to true.',
